class Cell {
  constructor(
    id,
    children,
    x,
    y,
    radius,
    r,
    g,
    b,
    o,
    energi,
    celldelningsProgress,
    jumpLength,
    energiUpptagning,
    delningsEffektivitet,
    ctx
  ) {
    this.id = id;
    this.children = children;
    this.x = x;
    this.y = y;
    this.radius = radius;
    this.r = r;
    this.g = g;
    this.b = b;
    this.o = o;
    this.color = `rgba(${r},${g},${b},${o})`;
    this.energi = energi;
    this.celldelningsProgress = celldelningsProgress;
    this.jumpLength = jumpLength;
    this.energiUpptagning = energiUpptagning;
    this.delningsEffektivitet = delningsEffektivitet;
    this.dead = false;
    this.ctx = ctx;
  }

  draw() {
    this.ctx.beginPath();
    this.ctx.arc(this.x, this.y, this.radius, 0, Math.PI * 2, false);

    if (!this.dead) {
      if (this.children > 0) {
        this.ctx.strokeStyle = "black";
      } else this.ctx.strokeStyle = "green";
    } else {
      if (this.children === 0) {
        this.ctx.strokeStyle = "red";
      } else this.ctx.strokeStyle = "yellow";
    }
    this.ctx.stroke();

    this.ctx.fillStyle = this.color;
    this.ctx.fill();

    this.ctx.beginPath();
    this.ctx.fillStyle = "#3df322";
    this.ctx.fillRect(
      this.x - this.radius,
      this.y + this.radius * 1.5,
      ((this.radius * 2) / 1000) * this.celldelningsProgress,
      3
    );

    this.ctx.fillStyle = "#aaf322";
    this.ctx.fillRect(
      this.x - this.radius,
      this.y + this.radius * 1.1,
      ((this.radius * 2) / 1000) * this.energi,
      3
    );
  }

  update() {
    this.jump();
    this.draw();

    if (this.energi >= 0) {
      this.energi -= 0.6;
    }
    if (this.celldelningsProgress >= 0) {
      this.celldelningsProgress -= 0.3;
    }
  }

  jump() {
    const jumpY = Math.random();
    const jumpX = Math.random();
    if (jumpX > 0.6666) {
      if (this.x < 702 - this.radius) this.x += this.jumpLength;
    }
    if (jumpX < 0.3334) {
      if (this.x > 0 + this.radius) this.x -= this.jumpLength;
    }
    if (jumpY > 0.6666) {
      if (this.y < 425 - this.radius) this.y += this.jumpLength;
    }
    if (jumpY < 0.3334) {
      if (this.y > 0 + this.radius) this.y -= this.jumpLength;
    }
  }
}

export default Cell;
